import React,{useState,useEffect} from 'react';
import { styled } from '@mui/material/styles';
import {Box,List,ListItem,ListItemAvatar,ListItemText,IconButton,Typography,Link} from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';
import Navbar from './Navbar';
import axios from 'axios';
function generate(element) {
  return items.map((value,index) =>
    React.cloneElement(element, {
      key: index,
    }),
  );
}
const Demo = styled('div')(({ theme }) => ({
  backgroundColor: theme.palette.background.paper,
}));
const api=axios.create({
  baseURL:"http://localhost:5000/custom"
})
export default function Cart() {
  const [checked, setChecked] = React.useState([1]);
  const [dense, setDense] = React.useState(false);
  const [secondary, setSecondary] = React.useState(true);
  const [carts,setcarts]=useState([]);
  useEffect(()=>{
      api.get('/cart',{
        withCredentials:true
      })
      .then(res=>{
        // console.log(res.data);
        setcarts([...res.data]);
      })
      .catch(err=>{
        console.log(err);
      })
      
  },[])
  return (
    <Box sx={{ flexGrow: 1, width:"100%" }}>
        <Navbar/>
        <Box sx={{position:"relative"}}>
            <Typography sx={{ mt: 4, mb: 2 }} variant="h3" component="div">
                Your Items
            </Typography>
            <List   dense={dense} sx={{
                position: "absolute",
                top: "15%",
                left:" 5%",
                width:"90%",
                mt:"20px"
        }}
        >
            {
          carts.map((cart)=>(  
            <ListItem   key={cart.cid}
            sx={{
                height:"150px"
            }}
            secondaryAction={
                <IconButton edge="end" aria-label="delete">
                <DeleteIcon />
                </IconButton>
            }
        >
        <ListItemAvatar>
            <Box 
            sx={{
                height:"150px",
                width:"150px",
                ml:"2px",
                mr:"5px",
                backgroundColor:"greenyellow"
            }} 
            > 
            <img
                    src={`$http://localhost:5000/images/${cart.Product.letmeSee}`}
                    alt={value.title}
                    loading="lazy"
                    
                    style={{
                      width:"100px",
                      height:"100px"
                    }}
                />
            </Box>
        </ListItemAvatar>
        <ListItemText
            primary={cart.Product.pname}
            secondary={cart.Product.price}
            />
        </ListItem> 
          )
        )
      }
            </List>
            </Box>
    </Box>
  );
}
